import Nav from "./Nav"
import Booking from "./Booking"
import "./ImagesCSS.css"
import Product from "./Product"
import Services from "./Services"
import AboutUs from "./AboutUs"

function App() {
  return (
    <div className="App">
      <Nav />
      <Booking />
      <Product/>
      <Services/>
      <AboutUs/>
    </div>
  );
}

export default App;
